function encode(str) {
  var encoded = '';
  for (var i = 0; i < str.length; i++) {
    var char = str.charCodeAt(i);
    if (char > 127) {
      var char2 = char & 63;
      var char3 = char >> 6;
      encoded += String.fromCharCode(192 + char3) + String.fromCharCode(128 + char2) + String.fromCharCode(128 + (char & 63) >> 6);
    } else {
      encoded += String.fromCharCode(char);
    }
  }
  return encoded;
}

function decode(encoded) {
  var decoded = '';
  for (var i = 0; i < encoded.length; i += 3) {
    var char3 = encoded.charCodeAt(i);
    var char2 = encoded.charCodeAt(i + 1);
    var char = encoded.charCodeAt(i + 2);
    decoded += String.fromCharCode(char3 - 192) + String.fromCharCode(char2 - 128) + String.fromCharCode(char - 128);
  }
  return decoded;
}
